You can interact with the daemon through simple HTTP PUT requests. For example, with cURL , you can store blobs using a publisher or daemon as follows: ADDRESS="127.0.0.1:31415"
curl -X PUT "http://$ADDRESS/v1/store" -d "some string" # store the string `some string` for 1 storage epoch
curl -X PUT "http://$ADDRESS/v1/store?epochs=5" --upload-file "some/file" # store file `some/file` for 5 storage epochs The store HTTP API end points return information about the blob stored in JSON format. When a blob is stored for the first time, a newlyCreated field contains information about the new blob: $ curl -X PUT "http://ord-dnt-sto-00.devnet.sui.io:9000/v1/store" -d "some other string"
{ "newlyCreated":{ "id":"0xa74d376bb6923c4b8d73825fce3b798524e2bda34d02dae64ab5865556c54000", "storedEpoch":0, "blobId":"gsYzDXsK326Wihzt3X5evZCPFgaNZrb84zCjodLJaVs", "size":36, "erasureCodeType":"RedStuff", "certified":0, "storage":{ "id":"0x2479b3096efa58fa9bfbebe805268746c235110ee0713e5a123d8f1754c2ccc3", "startEpoch":0, "endEpoch":1, "storageSize":4747680 } }
} The information returned is the content of the Sui blob object . When the aggregator finds a certified blob with the same blob ID and a sufficient validity period, it returns a alreadyCertified JSON structure: $ curl -X PUT "http://ord-dnt-sto-00.devnet.sui.io:9000/v1/store" -d "some other string"
{ "alreadyCertified":{ "blobId":"gsYzDXsK326Wihzt3X5evZCPFgaNZrb84zCjodLJaVs", "event":{ "txDigest":"2oMC1dTaMGpApphFWKzARSsTM9837ox4zN8rY2RqLf6c", "eventSeq":"0" }, "endEpoch":1 }
} The field event returns the Sui event ID that can be used to find the transaction that created the Sui Blob object on the Sui explorer or using a Sui SDK.

