A Walrus Site is represented on Sui as a very simple object: struct Site has key, store { id: UID, name: String,
} The resources associated with this site are then added to this object as dynamic fields of type Resource: struct Resource has store, drop { path: String, content_type: String, content_encoding: String, // The walrus blob id containing the bytes for this resource blob_id: u256,
} Each resource contains: The path of the resource, for example /index.html (all the paths are always represented as starting from root /); the content_type of the resource, for example text/html; the content_encoding of the resource. At the moment the only available value is plaintext; and the blob_id, which is the Walrus blob ID where the resource can be found. These Resource dynamic fields are keyed with a struct of type ResourcePath struct ResourcePath has copy, store, drop { path: String,
} This struct just holds the string of the path (/index.html); having a separate type ensures that we will not have namespace collisions with other dynamic fields, possibly added by other packages. To see this in action, look at a Walrus Site in the explorer , and check its dynamic fields.

